import React, { Component } from "react";
import axios from "axios";
import { starshipsUrl } from "../../config";
import StarShip from "./StarShip";
import Header from "../Header";

class StarShipsList extends Component {
  state = {
    shipInfo: []
  };

  componentDidMount() {
    const getData = async () => {
      try {
        const res = await axios.get(starshipsUrl);
        console.log(res.data.results.name);
        this.setState({
          shipInfo: res.data.results
        });
      } catch (error) {
        console.log(error);
      }
    };
    return getData();
  }
  render() {
    return (
      <>
        <header />
        <div>
          {this.state.shipInfo.map(info => {
            <StarShip
              name={info.name}
              model={info.model}
              cargo={info.cargo_capacity}
            />;
          })}
        </div>
      </>
    );
  }
}

export default StarShipsList;
